var Player = function (phaser, p) {
    this.phaser = phaser;
    var group = phaser.add.group();

	
    var p = phaser.add.sprite(0, 0, 'player');
    p.order = 0;
    group.addChild(p);


    // default
    var pd = phaser.add.sprite(3, 3, 'player_default');
    pd.anchor.setTo(0, 0);    
    pd.order = -2;
    group.addChild(pd);

    // 桌號底板
    var tb = phaser.add.sprite(0, 0, 'player_table');
    tb.anchor.setTo(0.5, 0.5);
    tb.order = 2;
    tb.reset(8, 8);
    group.addChild(tb);

    // 桌號文字
    var tt = phaser.add.text(9, 10, "0", {
        font: '16px Arial',
        fill: '#5A3616',
        align: 'center',
        strokeThickness: 1
    });
    tt.order = 3;
    tt.anchor.setTo(0.5, 0.5);
	group.addChild(tt);

    // 名稱
    var pn = phaser.add.text(95, 108, "name", {
        font: '16px Arial',
        fill: '#5A3616',
        align: 'right',
        strokeThickness: 1
    });
    pn.order = 1;
    pn.anchor.setTo(1, 0.5);
	group.addChild(pn);        

    //登入狀態
    var on = phaser.add.sprite(13, 108, 'player_on');
    on.anchor.setTo(0.5, 0.5);
    on.order = 1;
	group.addChild(on);    

    var off = phaser.add.sprite(13, 108, 'player_off');
    off.anchor.setTo(0.5, 0.5);
    off.order = 1;
	group.addChild(off);

	this.bodys = {};
	this.bodys['table_bg'] = tb;
	this.bodys['name'] = pn;
	this.bodys['table_num'] = tt;
	this.bodys['on'] = on;
	this.bodys['off'] = off;
	this.bodys['player'] = p;	
    // this.body = p;

    // group.visible = false;
    // this.visible = group.visible;
    this.body = group;

    this.body.customSort(function(a,b){return a.order - b.order});    
    this.score = 0;

    this.baseSpeed = Math.random() * 2.0 + 1;
    var self = this;
    setTimeout(function(){
        self.baseSpeed = Math.random() * 4 + 2;
    },2000);
};

Player.prototype.set = function (pid, name, table_num, avatar) {
    this.pid = pid;
	this.bodys['name'].text = name;
	this.bodys['table_num'].text = table_num;
    if (avatar) {
        console.log('!!!!!');
        console.log(avatar);
    }
    // if (!avatar && Math.random()>0.5)
        // avatar = 'data:image/png;base64,';
    if (avatar) {
        var key = 'player_avatar_'+pid;
        var self = this;
        var data = new Image();        
        data.onload = function () {
            console.log('onload ',data.src);
            self.phaser.cache.addImage(key, avatar, data);                     
            self.delayload(key);
        };
        data.src = avatar;
        
        // var fuck = this.phaser.cache.checkImageKey(key);

        // console.log(phaser.cache.getKeys(Phaser.Cache.IMAGE));

        // console.log(pid, fuck, avatar);

        // this.phaser.cache.removeImage(key);
        // setTimeout(this.delayload.call(this, key), 0);
    }
};

Player.prototype.delayload = function (key) {
    console.log('load start ',key, this.phaser.cache.checkImageKey(key));
    var av = this.phaser.add.sprite(5, 7, key);
    av.width = 95;
    av.height = 95;
    av.order = -1;
    this.body.addChild(av); 
    this.body.customSort(function(a,b){return a.order - b.order});    
    // this.body.visible = true;    
}

Player.prototype.online = function (flag) {
	this.bodys['on'].visible = flag;
	this.bodys['off'].visible = !flag;
};

Player.prototype.visible = function (flag) {
	this.body.visible = flag;
};

Player.prototype.update = function (fps) {
    var s = this.score < this.baseSpeed ? this.baseSpeed : this.score;
    this.body.y -= (s/fps) * 2;
};

Player.prototype.end = function (r) {
    var rank = this.phaser.add.sprite(0, 0, 'rank');
    rank.parent = this.bodys['player'];
    rank.anchor.setTo(0, 1);
    var r = this.phaser.add.sprite(37, -22, 'rank' + r);
    r.parent = rank;    
}

